    [],nt"revision_timestamp": "2015-05-07T01:12:16.677857",nt"name": "titanium-matrix-composite-pressure-vessel-project-5198c",nt"isopen":
    true,nt"url": null,nt"notes": "For over 15 years, FMW Composite Systems
    has developed Metal Matrix Composite manufacturing methodologies for fabricating
    silicon-carbide-fiber-reinforced titanium components, also known as Titanium Matrix
    Composites (TMC), for the aerospace industry. These efforts have resulted in successfully
    flight qualifying three TMC components, including a piston rod used in the divergent
    exhaust nozzle actuator for the Pratt &amp; Whitney F119 engine (F-22), and two
    exhaust nozzle actuator links for the GE F110 engine (F-16). TMC weight savings
    over the monolithic titanium and steel components being replaced typically varies
    from 35 to 45&#37; depending upon the application load requirements. The relatively
    low density of TMC (10&#37; lower than Titanium) combined with its excellent mechanical
    behavior, results in significantly higher specific static properties than conventional
    material systems. Additionally, creep resistance of TMC is dramatically enhanced
    over monolithic titanium due to the presence of the SiC fibers, which do not exhibit
    discernible creep at the temperature regime of interest. Currently, FMW is working
    with closely with the aerospace industry to develop TMC structural components for
    both Military and Commercial airframe applications. FMW proposes to use this same
    technology to work with the Jet Propulsion Lab to develop a TMC pressure vessel
    for the Venus Lander mission.",nt"license_title": "U.S. Government Work",nt"extras":
